import React from "react";
import {Redirect} from "react-router-dom";
import { connect } from "unistore/react";
import { actions } from "../store";


const Profile = props => {

    console.log("is_login", props.is_login);
    // const self = this
    // this.props.postLogin2()

    if(!props.is_login){
        return (<Redirect to={{pathname: "/signin"}} />);
    } else {
        return (
            <section className="content container">
                <div className="container-profile">
                    <div className="row" style={{marginTop:"100px"}}>
                        <div className="col-2">
                            <div className="profile-picture">
                                <img id="profpic" src={props.pembeli_avatar}></img>                            
                            </div>
                        </div>
                        <div className="col-10">
                            <div className="user-profile">
                                <h3><label>Name: </label>{props.pembeli_username}</h3>
                                <h3><label>Name: </label>{props.pembeli_password}</h3>
                                <p><label>token: </label>{props.api_key}</p>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        );
    }
};

export default connect(["is_login", "api_key", "pembeli_email", "pembeli_username", "pembeli_password", "pembeli_namaLengkap", "pembeli_gender", "pembeli_lokasiKota", "pembeli_pekerjaan", "pembeli_avatar"], actions)(Profile);
